import React from "react";
import { Link } from "react-router-dom";

const onca = () => (
    <div className="info">
        <h1>Onça Pintada</h1>
        <p>A onça pintada é um dos felinos mais emblemáticos das Américas. Com sua pelagem alaranjada e pintas negras, é um animal que inspira respeito e admiração.
            Encontrada em diversos habitats, como florestas tropicais, savanas e pampas, a onça pintada é um predador de topo de cadeia alimentar, alimentando-se de uma grande variedade de presas, desde pequenos roedores até animais de grande porte como antas e capivaras.
            Infelizmente, a onça pintada também é uma espécie ameaçada de extinção, devido à perda de habitat, caça e conflitos com humanos. A conservação da espécie é fundamental para manter o equilíbrio dos ecossistemas e a biodiversidade.
            Diversas iniciativas de proteção da onça pintada têm sido realizadas, como a criação de áreas protegidas e projetos de reintrodução em áreas degradadas. É importante conscientizar a população sobre a importância de proteger a fauna e a flora, e contribuir para a conservação dessa magnífica espécie e de seu habitat natural.</p>
    </div>
);

export default onca;
